import Main from './Component/Main';
import Work from './Component/Work';
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
  <Routes>
        <Route path="/" element={<Main/>} />
        <Route path="work" element={<Work/>} />

      </Routes>
    </div>
  );
}

export default App;
